import { useContext } from "react";

import FavContext from "../store/fav-context";
import MeetupList from "../components/meetups/MeetupsList";
function FavsPage(params) {
  const favCtx = useContext(FavContext);


  return <div className="dark:bg-slate-950 bg-indigo-300 w-full dark:text-white text-black font-urbanist flex">
    <h1 > Favourites Page</h1>
      <MeetupList meetups={favCtx.favs}/>
      {console.log(favCtx.favs)}
  </div>;
}

export default FavsPage;
